import React from "react";

import classes from "./Todo.module.css";

const deleteHandler = () => {
  // setDeleteText('(Deleted!)');
  props.onDelete(props.id);
};

const Todo = (props) => {
  return (
    <li className={classes.todo}>
      <h2>{props.title}</h2>
      <p>{props.openingText}</p>
    </li>
  );
};

export default Todo;
